import React from 'react'
import axios from 'axios'

export default function Home() {
    
    const [users, setUsers] = React.useState([]);
    
    React.useEffect(() => {
        loadUsers();
    }, [])

    const loadUsers=async()=>{
        const result = await axios.get("http://localhost:8081/allUsers");
        setUsers(result.data);
    }

  return (
    <div className='container'>
        <div className='py-4'>
            <table className="table border shadow">
                <thead>
                    <tr>
                        <th scope="col">#</th>
                        <th scope="col">Vorname</th>
                        <th scope="col">Nachname</th>
                        <th scope="col">E-Mail</th>
                        <th scope="col">Aktion</th>
                    </tr>
                </thead>
                <tbody className='table-group-divider'>
                    {
                        users.map((user,index)=>
                        (
                            <tr>
                                <th scope="row" key={index}>{index+1}</th>
                                <td>{user.name}</td>
                                <td>{user.username}</td>
                                <td>{user.email}</td>
                                <td>
                                    <button type="button" className="btn btn-info">Ansicht</button>
                                    <div className="btn-group ms" role="group">
                                        <button type="button" className="btn btn-secondary">Bearbeiten</button>
                                        <button type="button" className="btn btn-danger">Delete</button>
                                    </div>
                                </td>
                            </tr>
                         ))
                    }
                </tbody>
            </table>
        </div>
    </div>
  )
}
